import { useNavigate, useParams } from "react-router-dom";

export const Form = () => {
  const navigate = useNavigate();
  const parameters: string | undefined = useParams().user;

  return (
    <>
      <p className="redirect-sign-up" onClick={() => navigate("/")}>
        Wanna go home?
      </p>

      <p className="sign-up-title">
        {`${parameters?.slice(0, 1).toUpperCase()}${parameters?.slice(1)}`} Sign
        Up{" "}
      </p>
      <p className="sign-up-description"></p>
      <input className="form-input"></input>
      <input className="form-input"></input>
      <input></input>
    </>
  );
};
